const sections = [
  { title: 'Your Graph Algorithm', link: '/graph' },
  { title: 'Your Data Structure', link: '/rbt' },
];

function Home() {
  return (
    <div className="home">
      <h1>Алгоритми та Структури Даних</h1>
      <div className="sections">
        {sections.map((section, index) => (
          <div key={index} className="section">
            <h2>{section.title}</h2>
            <Link to={section.link}>
              <button className="start">Start</button>
            </Link>
          </div>
        ))}
      </div>
      <footer>
        <p>Internet of Things 2024</p>
      </footer>
    </div>
  );
}

export default Home;
